TITLE:
  - "A bending beam problem with a embedded mesh coupling setup."
  - "This test is meant to test the parallel implementation"
  - "of the embedded mesh coupling with a fine discretization,"
  - "The size of the discretisation is necessary since it triggers"
  - "a special case in the parallel partitioning of the problem."
PROBLEM TYPE:
  PROBLEMTYPE: "Structure"
  SHAPEFCT: "Nurbs"
IO/RUNTIME VTK OUTPUT:
  INTERVAL_STEPS: 1
IO/RUNTIME VTK OUTPUT/STRUCTURE:
  OUTPUT_STRUCTURE: true
  DISPLACEMENT: true
  ELEMENT_OWNER: true
  ELEMENT_GID: true
  ELEMENT_GHOSTING: true
STRUCTURAL DYNAMIC:
  INT_STRATEGY: "Standard"
  DYNAMICTYPE: "Statics"
  TIMESTEP: 0.1
  NUMSTEP: 1
  MAXTIME: 1
  M_DAMP: 1e-05
  K_DAMP: 1e-05
  TOLDISP: 1e-08
  TOLRES: 1e-07
  MAXITER: 15
  LINEAR_SOLVER: 1
SOLVER 1:
  SOLVER: "Superlu"
  NAME: "Struct_Solver"
MESH PARTITIONING:
  METHOD: monolithic
XFEM GENERAL:
  GMSH_DEBUG_OUT: true
  GMSH_CUT_OUT: true
CUT GENERAL:
  GENERAL_POSITION_DISTANCE_FLOATTYPE: "double"
  GENERAL_POSITION_POSITION_FLOATTYPE: "double"
  DO_SELFCUT: false
  BOUNDARYCELL_CUBATURDEGREE: 1
  INTEGRATE_INSIDE_CELLS: false
EMBEDDED MESH COUPLING:
  COUPLING_STRATEGY: mortar
  MORTAR_SHAPE_FUNCTION: nurbs9
  CONSTRAINT_ENFORCEMENT: penalty
  CONSTRAINT_ENFORCEMENT_PENALTYPARAM: 100
DESIGN EMBEDDED SOLID VOL BACKGROUND CONDITIONS:
  - E: 2
    COUPLINGID: 1
MATERIALS:
  - MAT: 1
    MAT_Struct_StVenantKirchhoff:
      YOUNG: 100
      NUE: 0.3
      DENS: 7.8e-07
FUNCT1:
  - SYMBOLIC_FUNCTION_OF_SPACE_TIME: "t"
DESIGN SURF DIRICH CONDITIONS:
  - E: 7
    NUMDOF: 3
    ONOFF: [1, 1, 1]
    VAL: [0, 0, 0]
    FUNCT: [0, 0, 0]
  - E: 6
    NUMDOF: 3
    ONOFF: [1, 1, 1]
    VAL: [0, 0, 0]
    FUNCT: [0, 0, 0]
DESIGN EMBEDDED MESH SOLID SURF COUPLING CONDITIONS:
  - E: 4
    COUPLINGID: 1
DESIGN SURF NEUMANN CONDITIONS:
  - E: 5
    NUMDOF: 3
    ONOFF: [0, 1, 0]
    VAL: [0, -0.01, 0]
    FUNCT: [0, 1, 0]
STRUCTURE KNOTVECTORS:
  PATCHES:
    - KNOT_VECTORS:
        - DEGREE: 2
          TYPE: Interpolated
          KNOTS:
            - 0.0
            - 0.0
            - 0.0
            - 0.3333333333333333
            - 0.6666666666666666
            - 1.0
            - 1.0
            - 1.0
        - DEGREE: 2
          TYPE: Interpolated
          KNOTS:
            - 0.0
            - 0.0
            - 0.0
            - 0.3333333333333333
            - 0.6666666666666666
            - 1.0
            - 1.0
            - 1.0
        - DEGREE: 2
          TYPE: Interpolated
          KNOTS:
            - 0.0
            - 0.0
            - 0.0
            - 0.1
            - 0.2
            - 0.30000000000000004
            - 0.4
            - 0.5
            - 0.6000000000000001
            - 0.7000000000000001
            - 0.8
            - 0.9
            - 1.0
            - 1.0
            - 1.0
      ID: 1
